    insert: () => 3
  }), 3);
  assert.same(new WeakMap([[a, 2]]).emplace(a, {
    update: value => value ** 2
  }), 4);
  handler = {
    update() {
      /* empty */
    },

    insert() {
      /* empty */
    }

  };
