  assert.notThrows(() => [1, 2, 3].sort(undefined).length === 3, 'works with undefined');
  assert.throws(() => [1, 2, 3].sort(null), 'throws on null');
  assert.throws(() => [1, 2, 3].sort({}), 'throws on {}');

